def gys1(a,b):    #辗转相除法(欧几里德算法)
    if a<b:
        a,b=b,a
    while b!=0:
        temp=a%b
        a=b
        b=temp
    return a
def gys2(a,b):    #更相减损法
    while a!=b:
        if a<b:
            a,b=b,a
        temp=a-b
        a=temp
    return a

